import FollowerCard from './FollowerCard';
console.log(followers)
const FollowersCard = () => {
    return (
        <Box>
            <Box>
                <Typography>
                    Who is following You?
                </Typography>
            </Box>
            <Box>
                {followers.map(({ name, username, img }) => {
                    return <FollowerCard />
                })}
            </Box>
        </Box>
    )
}

export default FollowersCard
